import React, { Component } from 'react'

class Header extends Component {
  render() {
    return (
      <div style = {
           headerStyle.header
      }>
        <p stlye = {headerStyle.logo}>T</p>
        <p style = {headerStyle.task} >Tasks</p>
      </div>
    )
  }
}
const headerStyle = {
  header:{
    backgroundColor: '#D90062',
    color: '#fff',
    height: '66px',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
},
task:{
  backgroundColor: 'rgba(255, 255, 255, 0.2)',
  padding: '10px',
  paddingLeft: '20px',
  paddingRight: '20px',
  marginLeft: '10px',
  borderRadius: '25px',
  display: 'flex',
  justifyContent: 'center'
},
logo:{
  backgroundColor: 'white',
  width: '45px',
  height: '45px',
}

}


export default  Header;
